import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import images from "../../assets/images/carousel images";

function importAllImages(i) {
  let images = [];
  i.keys().forEach((item, index) => {
    images.push(i(item));
  });
  return images;
}

const image = importAllImages(
  require.context(
    "../../assets/images/carousel_images",
    false,
    /\.(png|jpe?g|svg)$/
  )
);

export default function Home() {
  return (
    <div className="home-page page-container">
      <h1>2950 WORLDWIDE</h1>
      <div className="box">
        <Carousel useKeyboardArrows={true}>
          {image.map((URL, index) => (
            <div className="slide">
              <img alt="sample" src={URL} key={index} />
            </div>
          ))}
        </Carousel>
      </div>
    </div>
  );
}
